        const war = await apidata.json();
        console.log(war);
    };
    watherapi();
      
    return(
        <>
        <div className='wather_app'>
               <input
               type='text'
               className='input'
               />
           <div className='info'>
               <h1 className='H1'>
               <PinDropIcon style={{
                fontSize: '2rem',
                marginRight: '5px'}}/>
                   gujrat
               </h1>
               <h2 className='H2'>ran</h2>
               <h4 className='H4'>Temp 12.2 ℃</h4>
               <p>mex ℃ | men ℃</p>
           </div>
        </div>
            
        </>
    );
};

export default App;
